db.patients.aggregate([
    { $unwind: "$ENCOUNTERS" },
    { $unwind: "$ENCOUNTERS.SUPPLIES" },
    { $match: {"ENCOUNTERS.SUPPLIES.DESCRIPTION": "Continuous positive airway pressure nasal oxygen cannula (physical object)"} },
    { $project: { _id: 0, supply_code: "$ENCOUNTERS.SUPPLIES.CODE" } }
])

db.patients.aggregate([
  { $unwind: "$ENCOUNTERS" },
  { $unwind: "$ENCOUNTERS.MEDICATIONS" },
  { $match: {
    "ENCOUNTERS.MEDICATIONS.CODE": 205923, // Simvastatin 10 MG Oral Tablet code
    "ENCOUNTERS.MEDICATIONS.SUCCESS_RATE": { $exists: true } // Ensure success rate exists
  }},
  { $group: {
    _id: null,
    avgSuccessRate: { $avg: "$ENCOUNTERS.MEDICATIONS.SUCCESS_RATE" }
  }},
  { $project: { _id: 0, avgSuccessRate: 1 }}
])

This query finds the success rate of medication Simvastatin 10 MG Oral Tablet by unwinding the ENCOUNTERS and MEDICATIONS arrays, filtering for the correct medication code, and then grouping by null to calculate the average success rate.

db.patients.aggregate([
    {
        $lookup: {
            from: "payers",
            localField: "PAYER_TRANSITIONS.PAYER_REF",
            foreignField: "PAYER_ID",
            as: "payer_details"
        }
    },
    { $unwind: "$PAYER_TRANSITIONS" },
    { $unwind: "$payer_details" },
    { $match: { "payer_details.NAME": "NO_INSURANCE" } },
    { $project: { _id: 0 } } ,
    { $group: {_id: null, count: { $sum: 1 } } }
])

db.patients.aggregate([
    {
        $lookup: {
            from: "payers",
            localField: "PAYER_TRANSITIONS.PAYER_REF",
            foreignField: "PAYER_ID",
            as: "payer_details"
        }
    },
    { $unwind: "$PAYER_TRANSITIONS" },
    { $unwind: "$payer_details" },
    { $match: { "payer_details.NAME": "Aetna" } },
