        "ENCOUNTERS.MEDICATIONS.CODE": "NDA020800",
        "ENCOUNTERS.MEDICATIONS.STRENGTH": "0.3 ML Epinephrine 1 MG/ML Auto-Injector"
    }},
    { $project: { _id: 0, success_rate: "$ENCOUNTERS.MEDICATIONS.SUCCESS_RATE" }}
