db.patients.aggregate([
    {
        $lookup: {
            from: "payers",
            localField: "PAYER_TRANSITIONS.PAYER_REF",
            foreignField: "PAYER_ID",
            as: "payer_details"
        }
    },
    {
        $unwind: "$PAYER_TRANSITIONS"
    },
    {
        $unwind: "$payer_details"
    },
    {
        $match: {
            "payer_details.NAME": "Humana"
        }
    },
    {
        $unwind: "$ENCOUNTERS"
    },
    {
        $unwind: "$ENCOUNTERS.MEDICATIONS"
    },
    {
        $match: {
            "ENCOUNTERS.MEDICATIONS.IS_COVERED": false
        }
    },
    {
        $group: {
            _id: null,
            count: { $sum: 1 }
        }
    },
    {
        $project: {
            _id: 0,
            number_of_uncovered_medications: "$count"
        }
    }
])

