db.patients.aggregate([
    {
        $lookup: {
            from: "organizations",
            localField: "ORGANIZATION_REF",
            foreignField: "ORGANIZATION_ID",
            as: "organization_details"
        }
    },
    { $unwind: "$organization_details" },
    { $match: { "organization_details.ORGANIZATION_ID": "2befa435-3070-3350-a15c-e43ac1e84b24" } },
    { $project: { _id: 0, first: "$FIRST", last: "$LAST" } },
    { $group: { _id: { first: "$first", last: "$last" } } },
    { $project: { _id: 0, first: "$_id.first", last: "$_id.last" } }
])

db.patients.aggregate([
    {
        $lookup: {
            from: "payers",
            localField: "PAYER_TRANSITIONS.PAYER_REF",
            foreignField: "PAYER_ID",
            as: "payer_details"
        }
    },
    { $unwind: "$PAYER_TRANSITIONS" },
    { $unwind: "$payer_details" },
    { $match: { "payer_details.PAYER_ID": "e03e23c9-4df1-3eb6-a62d-f70f02301496" } },
    {
        $project: {
            _id: 0,
            encounters: "$ENCOUNTERS"
        }
    },
    {
        $unwind: "$encounters"
    },
    {
        $group: {
            _id: null,
            uncovered_encounters: {
                $push: {
                    $cond: [
                        { $eq: [ "$encounters.IS_COVERED", false ] },
                        "$encounters",
                        false
                    ]
                }
            }
        }
    },
    {
        $project: {
            _id: 0,
            count: { $size: { $filter: { input: "$uncovered_encounters", cond: { $ne: [ "$$this", false ] } } } }
        }
    }
])

