db.patients.aggregate([    {        $lookup: {            from: "payers",            localField: "PAYER_TRANSITIONS.PAYER_REF",            foreignField: "PAYER_ID",            as: "payer_details"        }    },    {        $unwind: "$PAYER_TRANSITIONS"    },    {        $unwind: "$payer_details"    },    {        $match: {            "payer_details.PAYER_ID": "e03e23c9-4df1-3eb6-a62d-f70f02301496"        }    },    {        $project: {            start_date: "$PAYER_TRANSITIONS.START_DATE",            end_date: "$PAYER_TRANSITIONS.END_DATE"        }    },    {        $group: {            _id: null,            total_months: {                $sum: [{                    $cond: [                        { $and: [                            { $gte: [ "$start_date", ISODate("1970-01-01T00:00:00.000Z") ], },                            { $lt: [ "$end_date", ISODate("1970-01-01T00:00:00.000Z") ] }                        ]}                    ]},                    0,                    {                        $monthsBetween: [ "$start_date", "$end_date" ]                    }                 ]
             }
         }
     }
])

