db.patients.aggregate([    {        $lookup: {            from: "payers",            localField: "PAYER_TRANSITIONS.PAYER_REF",            foreignField: "PAYER_ID",            as: "payer_details"        }    },    {        $unwind: "$PAYER_TRANSITIONS"    },    {        $unwind: "$payer_details"    },    {        $match: {            "payer_details.PAYER_ID": "0133f751-9229-3cfd-815f-b6d4979bdd6a",            "PAYER_TRANSITIONS.TRANSITION_TYPE": "Coverage"        }    },    {        $unwind: "$ENCOUNTERS"    },    {        $group: {            _id: {                payer_id: "$payer_details.PAYER_ID",                encounter_id: "$ENCOUNTERS.ENCOUNTER_ID"            },            uncovered: {                $cond: {                    if: {                        $eq: [ "$PAYER_TRANSITIONS.TRANSITION_TYPE", "Coverage" ]                    },                    then: {                        $cond: {                            if: {                                $eq: [ "$PAYER_TRANSITIONS.COVERAGE_STATUS", "Uncovered" ]                            }
```
                            , 1, 0
                        }
                    },
                    else: 0
                }
            }
        }
    },
    {
        $group: {
            _id: "$_id.payer_id",
            total_uncovered_encounters: { $sum: "$uncovered" }
