db.patients.aggregate([
    {
        $lookup: {
            from: "payers",
            localField: "PAYER_TRANSITIONS.PAYER_REF",
            foreignField: "PAYER_ID",
            as: "payer_details"
        }
    },
    { $unwind: "$PAYER_TRANSITIONS" },
    { $unwind: "$payer_details" },
    { $match: { "payer_details.PAYER_ID": "26aab0cd-6aba-3e1b-ac5b-05c8867e762c" } },
    {
        $project: {
            _id: 0,
            immunizations_count: {
                $size: {
                    $filter: {
                        input: "$ENCOUNTERS",
                        as: "encounter",
                        cond: {
                            $and: [
                                { $eq: ["$$encounter.ENCOUNTER_TYPE", "IMMUNIZATION"] },
                                { $eq: ["$$encounter.PAYER_REF", "26aab0cd-6aba-3e1b-ac5b-05c8867e762c"] }
                            ]
                        }
                    }
                }
            }
        }
    }
])

db.patients.aggregate([
