        $lookup: {
            from: "imaging_studies",
            localField: "IMAGING_STUDIES.STUDY_REF",
            foreignField: "STUDY_ID",
            as: "imaging_details"
        }
    },
    { $unwind: "$IMAGING_STUDIES" },
    { $unwind: "$imaging_details" },
    { $match: { "imaging_details.SERIES.SERIES_UID": "1.2.840.99999999.1.63663889.1660767155882" } },
