])

db.patients.aggregate([
    {
        $unwind: "$ENCOUNTERS"
    },
    {
        $lookup: {
            from: "payers",
            localField: "ENCOUNTERS.PAYER_REF",
            foreignField: "PAYER_ID",
            as: "payer_details"
        }
    },
    {
        $unwind: "$payer_details"
    },
    {
        $match: {
            "payer_details.NAME": "Medicare"
        }
    },
    {
        $group: {
            _id: null,
            uncovered_encounters: {
                $sum: {
                    $cond: [{ $eq: ["$payer_details.COVERAGE_TYPE", "UNCOVERED"] }, 1, 0]
                }
            }
        }
    },
    {
        $project: {
            _id: 0,
            uncovered_encounters: 1
        }
    }
])

db.patients.aggregate([
