  { $unwind: "$ENCOUNTERS.ALLERGIES" },
  { $match: { "ENCOUNTERS.ALLERGIES.DESCRIPTION": "Mold (organism)" } },
  { $unwind: "$ENCOUNTERS.PROCEDURES" },
  { $group: {
      _id: {
        patient_id: "$_id",
        procedure_code: "$ENCOUNTERS.PROCEDURES.CODE",
        procedure_description: "$ENCOUNTERS.PROCEDURES.DESCRIPTION"
      },
      promising_procedure_count: { $sum: 1 }
    }
  },
  { $sort: { "promising_procedure_count": -1 } },
  { $limit: 1 },
  { $project: {
      _id: 0,
      patient_id: "$_id.patient_id",
      procedure_code: "$_id.procedure_code",
      procedure_description: "$_id.procedure_description"
    }
  }
])

